P_7.P_7C:
Format oraz podstawa sporządzenia sprawozdania finansowego.
Sprawozdanie finansowe zostało sporządzone zgodnie z przepisami ustawy z dnia 29 września 1994 roku o rachunkowości. 
Sprawozdanie finansowe zostało sporządzone zgodnie z konwencją kosztu historycznego.
Rachunek zysków i strat Spółka sporządziła w wariancie porównawczym.
Sprawozdanie finansowe Spółki zostało przygotowane dla jednostek podlegających obowiązkowi badania i ogłaszania sprawozdań finansowych zgodnie z art. 64 ust. 1:
1.Spółka sporządziła sprawozdanie finansowe w formie uproszczonej wykazując informacje w zakresie ustalonym w załączniku nr 5 do UoR literami i cyframi rzymskimi (zwolnienie z art. 50 ust 2 UoR);
2.Sprawozdanie finansowe Spółki zostało również przygotowane z zastosowaniem dodatkowych zwolnień przewidzianych w UoR związanych z nieprzekroczeniem wielkości dotyczących przychodów ze sprzedaży, sumy bilansowej, zatrudnienia  określonymi w art. 50 UoR i art. 56 UoR:
3.Spółka odstąpiła od sporządzania rachunku przepływów pieniężnych oraz zestawienia zmian w kapitale własnym (zwolnienie z art. 45 ust. 2 i 3 UoR);
4.Spółka klasyfikuje umowy leasingowe, o których mowa w art. 3 ust. 4 UoR, według zasad określonych w przepisach podatkowych (zwolnienie z art. 3 ust. 6 UoR);
5.Spółka dokonuje wyceny instrumentów finansowych wyłącznie na podstawie przepisów ustawy rachunkowości określonych w art. 28 i 35
